import React from 'react';
import Table from 'react-bootstrap/Table';
import Card from 'react-bootstrap/Card';
import Emoji from './Emoji';
import HistoryTab from './HistoryTab';
import AdminTab from './AdminTab';


const DownloadsTable = () => {

  // fetch('../data/downloadsevent.json')
  // .then(response => {return response.json();})
  // .then(data => console.log(data));

  const data = require('./downloadsevents.json');
  console.log(data);

  return(
  <div name="Downloads History Table" Style="margin: 7em;">
    <AdminTab />
    <HistoryTab selectProp="event" />
    <Card>
      <Card.Body>
        <h3 Style="text-align:left;"><Emoji symbol="ðŸŽ§"/> Downloads History Table</h3>
      </Card.Body>
    </Card>

    <Table striped bordered hover>
      <thead>
        <tr>
          <th>ID</th>
          <th>Socket</th>
          <th>Sond ID</th>
          <th>Download Time</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>ObjectId("6069e5a6389064121b0c3a3c")</td>
          <td>uS1-SK23CC6kLD-dAAAB</td>
          <td>6</td>
          <td>2021-04-04 16:13:26.117Z</td>
        </tr>
        <tr>
          <td>ObjectId("6069e5a6389064121b0c3a3c")</td>
          <td>uS1-SK23CC6kLD-dAAAB</td>
          <td>6</td>
          <td>2021-04-04 16:13:26.117Z</td>
        </tr>
        <tr>
          <td>ObjectId("6069e5a6389064121b0c3a3c")</td>
          <td>uS1-SK23CC6kLD-dAAAB</td>
          <td>6</td>
          <td>2021-04-04 16:13:26.117Z</td>
        </tr>
      </tbody>
    </Table>

  </div>
  );
}

export default DownloadsTable;
